import React from "react";

function Card(){
    return(
        <div className="card" id="today-card">
            <h3 className="day">Monday</h3>
            <h1 className="temp">100&deg;</h1>
            <p className="clouds">Sunny</p>

            <div className="rain">
                <p>Chance of Rain</p>
                <p>5%</p>
            </div>

            <div className="high-low">
                <div>
                    <p>High</p>
                    <p>72</p>
                </div>
                <div>
                    <p>Low</p>
                    <p>64</p>
                </div>
            </div>
        </div>
    );
};

export default Card;
